import React from "react";
import { Box, Typography } from "@mui/material";
import propic from "./alyssa.jpg";
import "./App.css";
import Header from "./components/Header";
import { makeStyles } from "@mui/styles";

const useStyles = makeStyles({
  root: {

  },
  content: {
    display: "flex",
    flexDirection: "column",
    height: "100%",
    alignItems: "center",
    justifyContent: "center",
  },
  title: {
    backgroundColor: "#24305E",
    /*color: #A8D0E6;*/
    color: "white",
    padding: "10px",
  },
  text: {
    display: "flex",
    justifyContent: "center",
  },
});

function App() {
  const classes = useStyles();

  return (
    <>
      <Box className={classes.content}>
        <img id="profile-pic" src={propic} alt="Alyssa Wang"></img>
        <Box className="typewriter" sx={{ marginBottom: "10px" }}>
          <Typography variant="h3" className={classes.title}>
            {"\u00A0"}ALYSSA WANG{"\u00A0"}
          </Typography>
        </Box>
        <Typography className={classes.text}>
          SWE at <a href="https://www.mitre.org/">{"\u00A0"}MITRE</a>
        </Typography>
        <Typography className={classes.text}>
          <a href="https://www.williams.edu/">Williams College</a>
          {"\u00A0"}'20
        </Typography>
        <Typography className={classes.text}>
          <a href="https://csci.williams.edu/"> Computer Science{"\u00A0"}</a> •
          <a href="https://comp-lit.williams.edu/">
            {"\u00A0"}Comparative Literature
          </a>
        </Typography>
        <Typography className={classes.text}>
          <a href="https://github.com/AlyssaWang">Github{"\u00A0"}</a> •
          <a href="https://linkedin.com/in/alyssacwang">{"\u00A0"}LinkedIn</a>
        </Typography>
      </Box>
    </>
  );
}

export default App;
